			  height: '50px',
  			  textAlign: 'left',
  			  marginBottom: '10px'	,
			  marginTop:'10px',
			  marginRight: '30px'
  			}}
		/>
		</div>
			<ShowPlants />
		</div>

    </div>
);
};

export default Main;
